window.bookSummaryJSON = "<p>In this podcast episode, San Diego Divorce and child custody attorney, Brian A. Victor discusses the topic of what documents may be necessary in order to begin the divorce process.&nbsp;</p><p>Listen to Attorney Victor as he provides insight into the documents that should be considered when preparing for divorce and the necessary documents your attorney may need from you to begin your court matter.</p><p>Attorney Brian A. Victor has experience both in the field of psychology as well as in divorce and child custody in San Diego. He worked at Family Court Services in San Diego for more than 11 years where he created and recommended to family court judges parenting plans for parents unable to reach agreement on a child custody plan.</p><p>Remember to subscribe to Attorney Victorâ€™s podcast on iTunes so as not to miss any important discussions regarding divorce and child custody.<br><br>The information provided in this podcast is to inform rather than to provide legal advice and nothing in this podcast creates an attorney client relationship.&nbsp;</p>"; 
